                <p>Michigan's Premier Infectious Disease Physician and Wound Care Facility</p>
            </header>

            <div className="homeSection1">
            <img src={triple} alt="Dr. Ruben with a Patient" className="homeSection1Pic"/>
            <div id="texty1"><h4 className="homeSection1txt">We're committed to impeccable patient care.</h4></div>

